import React from 'react';
import PizzaCard from './PizzaCard'


const PizzaCardList = ({pizzas}) => {
	const cardComponent = pizzas.map((user, i) => {
    return (
      <PizzaCard key={user[i].id}
        id={user[i].id}
        name={user[i].name}
        email={user[i].email} />
    )
  })
  return (
    <div className="AllSabores">
      {cardComponent}
    </div>
  )
};

export default PizzaCardList;
